comment.body:
The issue is that you're generating a random hashCode inside of your state class. You should initialize it either with a [state factory](https://airbnb.io/mavericks/#/factories?id=creating-a-state-class) in the companion object of your ViewModel or by calling setState in init. However, if you do the latter, you can't create a random variable inside of setState or else you'll wind up with the same error.
```
init {
	val initialUUID = UUID.randomUUID().toString()
    setState { copy(uuid = initialUUID) }
}
```
